(516, 1, '2021-11-20 04:37:58', '2021-11-20 04:37:58', '<b>Ketentuan File Cetak di Suburprint:</b>\n\n<b>1. Berapa resolusi file yang dianjurkan untuk diupload?</b>\n<p class=\"p-1\">Agar file tidak pecah saat di-print, kami menganjurkan Anda mengirimkan resolusi file di atas 300dpi.</p>\n<b>2. Berapa resolusi file yang dianjurkan untuk diupload?</b>\n<p class=\"p-1\">Anda bisa mengecek kualitas cetakan dengan:</p>\n<p class=\"p-2\">- Untuk File Photoshop atau JPEG buka di Program Photoshop lalu Klik Image &gt; Image Size. Maka akan keluar kotak dialog Image Size. Pastikan resolusinya sudah 300 pixel/inch.</p>\n<p class=\"p-2\">- Perbesar File JPEG anda dalam Program Photoshop dengan Zoom in hingga 150% jika kualitas tidak pecah berarti tidak masalah.</p>\n<b>3. Tipe media penyimpanan apa saja yang dapat saya gunakan?</b>\n<p class=\"p-1\">Kami menerima upload file melalui media penyimpanan WeTransfer, Dropbox, dan Google Drive. Selain itu kami juga menerima file melalui email.</p>\n<b>4. Bisakah saya mengirimkan file yang sangat besar?</b>\n<p class=\"p-1\">Anda bisa mengirimkan file hingga sebesar 2GB (giga byte) melalui WeTransfer, Dropbox, dan Google Drive.</p>\n<b>5. Mode warna apa yang dianjurkan untuk diupload?</b>\n<p class=\"p-1\">Kami menerima mode warna CMYK.</p>', 'Ketentuan File', '', 'publish', 'open', 'open', '', 'ketentuan-file', '', '', '2021-11-20 04:37:58', '2021-11-20 04:37:58', '', 0, 'http://localhost/suburprint/?p=516', 0, 'post', '', 0),
