(1427, 1, '2021-11-25 01:13:51', '2021-11-25 01:13:51', '<img width=\"480\" height=\"250\" src=\"http://localhost/suburprint/wp-content/uploads/2021/11/Logo-2.png\" alt=\"\" loading=\"lazy\" />															\n			<h2>Suburprint</h2>		\n		<p>Lorem Ipsum is simply dummy text of the printing and typesetting industry. Lorem Ipsum has been the industry\'s standard dummy text ever since the 1500s,</p>		\n			<a href=\"#\" role=\"button\">\n						Pesan Sekarang\n					</a>\n			<h2>Layanan Unggulan</h2>		\n				<h3>\n						Jaminan Kepuasan 100%					\n				</h3>\n									<p>\n						Kami menjamin kualitan produk dengan garansi cetak ulang.					</p>\n				<h3>\n						Murah Harganya					\n				</h3>\n									<p>\n						Dapatkan penawaran harga terbaik secara real-time					</p>\n				<h3>\n						Cepat Sampainya					\n				</h3>\n									<p>\n						Produk langsung dikirim ke alamat tujuan sesuai metode yang dipilih.					</p>\n			<h2>Produk Unggulan</h2>		\n												<figure>\n										<img width=\"543\" height=\"470\" src=\"http://localhost/suburprint/wp-content/uploads/2021/11/Unggulan-Stiker.png\" alt=\"\" loading=\"lazy\" />											<figcaption>Stiker</figcaption>\n										</figure>\n												<figure>\n										<img width=\"545\" height=\"271\" src=\"http://localhost/suburprint/wp-content/uploads/2021/11/Unggulan-Brosur.png\" alt=\"\" loading=\"lazy\" />											<figcaption>Brosur</figcaption>\n										</figure>\n												<figure>\n										<img width=\"259\" height=\"189\" src=\"http://localhost/suburprint/wp-content/uploads/2021/11/Produk-Lainnya-Kartu-Nama.png\" alt=\"\" loading=\"lazy\" />											<figcaption>Kartu Nama</figcaption>\n										</figure>\n												<figure>\n										<img width=\"263\" height=\"193\" src=\"http://localhost/suburprint/wp-content/uploads/2021/11/Unggulan-Banner-Indoor.png\" alt=\"\" loading=\"lazy\" />											<figcaption>Banner Indoor</figcaption>\n										</figure>\n			<h2>Produk Lainnya</h2>		\n			<h2>Klien Kami</h2>		\n								<figure><img src=\"http://localhost/suburprint/wp-content/uploads/2021/11/Klien-1.png\" alt=\"Klien-1\" /></figure><figure><img src=\"http://localhost/suburprint/wp-content/uploads/2021/11/Klien-2.png\" alt=\"Klien-2\" /></figure><figure><img src=\"http://localhost/suburprint/wp-content/uploads/2021/11/Klien-3.png\" alt=\"Klien-3\" /></figure><figure><img src=\"http://localhost/suburprint/wp-content/uploads/2021/11/Klien-4.png\" alt=\"Klien-4\" /></figure><figure><img src=\"http://localhost/suburprint/wp-content/uploads/2021/11/Klien-5.png\" alt=\"Klien-5\" /></figure><figure><img src=\"http://localhost/suburprint/wp-content/uploads/2021/11/Klien-3-1.png\" alt=\"Klien-3\" /></figure>			\n						Previous\n						Next\n			<h2>Apa Yang Pelanggan <br>\nKami Katakan</h2>		\n						Harga yang diberikan oleh suburprint sesuai dengan kualitas dan service.					\n						<img src=\"http://localhost/suburprint/wp-content/uploads/2021/11/Pelanggan-1.png\" alt=\"Hugo Adams\">\n								<cite>Hugo AdamsContent Creator</cite>			\n						Banyak pilihan produk yang ditawarkan. Kualitas unggul harga bersaing.					\n						<img src=\"http://localhost/suburprint/wp-content/uploads/2021/11/Pelanggan-2.png\" alt=\"Alex Alwi\">\n								<cite>Alex AlwiPengusaha</cite>			\n						Sebagai mahasiswa yang aktif di kampus untuk keperluan cetak sangat aman dikantong.					\n						<img src=\"http://localhost/suburprint/wp-content/uploads/2021/11/Pelanggan-3.png\" alt=\"Jhonson\">\n								<cite>JhonsonMahasiswa</cite>			\n														Previous\n														Next', 'Landing Page', '', 'publish', 'closed', 'closed', '', 'landing-page', '', '', '2021-11-25 01:13:51', '2021-11-25 01:13:51', '', 0, 'http://localhost/suburprint/?elementor_library=landing-page', 0, 'elementor_library', '', 0),
